from os import listdirfrom os.path import isfile, joinimport Helpersgx_path = "/home/shihab/sgx_projects/iot_sgx/experiments/"normal_path = "/home/shihab/CLionProjects/iot_analytics/experiments/"def get_timing_overhead():    print("timing ovrhead...")def get_execution_time():    print("calculating execution time...")    path = sgx_path    file_list = []    for f in listdir(path):        if isfile(join(path, f)) and 'execution_time' in f:            file_list.append(f)    print(file_list)    for filename in file_list:        filepath = join(path, filename)        data = Helper.read_data_from_file(filepath)        print("-------------------")        print("Filename: {0}, Total instances: {1}".format(filename, len(data)))        #print(data[0])        device_id = ""        count = 0        total_count = 0        total_time = 0        temp_time = 0        for line in data:            items = line.rstrip().split(";")            if len(items) == 3:                if (total_count>0 and items[1] != device_id) or total_count == len(data)-1:                    total_time += temp_time                    count += 1                device_id = items[1]                temp_time = int(items[2])                total_count += 1                #if total_count == 10000:                    #break        print("count={0}, total count={1}, total time={2}".format(count, total_count, total_time))        print("avg time = ", total_time / count)if __name__ == '__main__':    get_execution_time()